static const int8_t dense_2_bias[] = DENSE_2_BIAS_0;
static const nnom_bias_t dense_2_b = { (const void*)dense_2_bias, DENSE_2_BIAS_LSHIFT};

/* nnom model */
static int8_t nnom_input_data[12480];
static int8_t nnom_output_data[8];
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[15];

	new_model(&model);

	layer[0] = Input(shape(96, 65, 2), nnom_input_data);
	layer[1] = model.hook(Conv2D(8, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_w, &conv2d_b), layer[0]);
	layer[2] = model.active(act_relu(), layer[1]);
	layer[3] = model.hook(MaxPool(kernel(1, 8), stride(1, 8), PADDING_VALID), layer[2]);
	layer[4] = model.hook(Conv2D(8, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_1_w, &conv2d_1_b), layer[3]);
	layer[5] = model.active(act_relu(), layer[4]);
	layer[6] = model.hook(MaxPool(kernel(1, 4), stride(1, 4), PADDING_VALID), layer[5]);
	layer[7] = model.hook(Conv2D(8, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_2_w, &conv2d_2_b), layer[6]);
	layer[8] = model.active(act_relu(), layer[7]);
	layer[9] = model.hook(MaxPool(kernel(1, 2), stride(1, 2), PADDING_VALID), layer[8]);
	layer[10] = model.hook(Dense(32, &dense_w, &dense_b), layer[9]);
	layer[11] = model.hook(Dense(16, &dense_1_w, &dense_1_b), layer[10]);
	layer[12] = model.hook(Dense(8, &dense_2_w, &dense_2_b), layer[11]);
	layer[13] = model.hook(Softmax(), layer[12]);
	layer[14] = model.hook(Output(shape(8,1,1), nnom_output_data), layer[13]);
	model_compile(&model, layer[0], layer[14]);
	return &model;
}
